import './Table.css';

import  { useState,useEffect } from 'react';

function Table() {

  const [data, setData] = useState('');

  useEffect(()=>{

    var xhttp = new XMLHttpRequest();    
    xhttp.open("GET", "http://localhost:8080/api/getData");
    xhttp.send();
    xhttp.onload = function() {  
      if(this.status==200){
        let response=JSON.parse(this.responseText);
        setData(response);
        setTimeout(() => {
          alert(data[0].data['Name']);
        }, 100);
      }
    };


  },[]);


    return (
      <div className='container'>
          <div className='row'>Data-1 JSON </div>
          <div className='row top1 full record'>
              <div className='col-auto border'></div>
              <div className='col-auto border'><small>Identification number</small></div>
              <div className='col border'><small>Name</small></div>
              <div className='col border'><small>Gender</small></div>
              <div className='col border'><small>Risk</small></div>
              <div className='col border'><small>Hair length</small></div>
              <div className='col-auto border'><small>IQ</small></div>
              <div className='col border'><small>Admission date</small></div>
              <div className='col border'><small>Last breakdown</small></div>
              <div className='col border'><small>Yearly fee</small></div>
              <div className='col border'><small>Knows the joker?</small></div>
              <div className='col-auto border'></div>


          </div>
      </div>
    );
  }

  export default Table;
